INSERT INTO `qs_jobfair` VALUES ('138','8','1','1','1','1','0','苏州吴江区人力资源市场大型招聘会','#f00','1','综合','<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\"><b><span style=\"font-size:16.0pt;mso-bidi-font-size:14.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">吴江区<span lang=\"EN-US\">2013</span>年<span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\"><b><span style=\"font-size:16.0pt;mso-bidi-font-size:14.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">落实政策促就业，强化服务助成功&#8226;冬季大型公益招聘会<span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\"><b><span style=\"font-size:16.0pt;mso-bidi-font-size:14.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">通知<span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">各有关单位：<span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">&nbsp;&nbsp;&nbsp; </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">为深入贯彻落实党的十八届三中全会精神，充分发挥各地各人力资源市场在促进就业中的主导作用，进一步做好<span lang=\"EN-US\">2014</span>年各项就业工作。根据人力资源和社会保障部办公厅《关于举办<span lang=\"EN-US\">2013</span>年全国人力资源市场高校毕业生就业服务周活动的通知》（人社厅发【<span lang=\"EN-US\">2013</span>】<span lang=\"EN-US\">104</span>号）要求，我区将举办“<span lang=\"EN-US\">2013</span>年全国人力资源市场高校毕业生就业服务周吴江区人才招聘大会”。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;\"><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">苏州市吴江区是临沪临浙重要的制造业基地，人力资源服务需求强劲。一直以来，区人力资源市场秉承“服务民生、服务企业、服务发展”的宗旨，取得显著成绩。<span lang=\"EN-US\">2012</span>年，吴江区人力资源市场被江苏省人社厅评定为“江苏省五星级公共人力资源市场”。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent:24.0pt;mso-char-indent-count:2.0;\"><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">吴江区人力资源市场布局合理，设施齐全，功能完备。作为其载体的吴江区人力资源和社会保障服务大厦，总投资<span lang=\"EN-US\">3</span>个亿，总面积达<span lang=\"EN-US\">3</span>万平米。区人力资源市场于<span lang=\"EN-US\">2012</span>年<span lang=\"EN-US\">9</span>月正式建成投入使用，借鉴国内外多家人力资源市场的建设经验，专业规划，摊位宽敞。商务中心、网络控制、信息查询、技能测评等区域一应具有。市场招聘大厅达<span lang=\"EN-US\">2270</span>平米，档案室<span lang=\"EN-US\">80</span>平米，拥有室内室外二块大型<span lang=\"EN-US\">LED</span>电子显示屏，人数计数器、自助招聘摊位<span lang=\"EN-US\">12</span>个<span lang=\"EN-US\">,</span>常设招聘摊位<span lang=\"EN-US\">64</span>个，以及网络招聘室、视频招聘室、自助招聘摊位、面谈式招聘摊位等。实现了自助式求职招聘、摊位式洽谈招聘、网络招聘和视频招聘等功能。现将本次招聘会有关事项通知如下。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">一、主办、承办单位<span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">主办：吴江区人力资源和社会保障局<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">承办：吴江区就管中心、吴江区人力资源市场<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">二、时间、地点<span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">时间：<span lang=\"EN-US\">12</span>月<span lang=\"EN-US\">14</span>日（星期六）<span lang=\"EN-US\">8</span>：<span lang=\"EN-US\">30</span>―<span lang=\"EN-US\">12</span>：<span lang=\"EN-US\">00<o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">地点：吴江区人力资源市场（长安路<span lang=\"EN-US\">3223</span>号，人社大厦一楼）<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">三、招聘会主题<span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">落实政策促就业，强化服务助成功<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">四、有关要求<span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">1</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">、本次招聘会预设展位<span lang=\"EN-US\">80</span>个，用人单位免费进场，<span lang=\"EN-US\">2014</span>届高校毕业生及市内相关求职者均可免费进场应聘求职。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">2</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">、请用人单位请根据需要制定招聘计划。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">3</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">、请参加招聘的用人单位在<span lang=\"EN-US\">12</span>月<span lang=\"EN-US\">10</span>日前持营业执照副本、经办人身份证复印件及招聘信息电子版到吴江区人力资源市场（长安路<span lang=\"EN-US\">3223</span>号人社大厦一楼）报名或将营业执照副本、经办人身份证复印件及招聘信息电子版传真邮箱。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">4</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">、请用人单位自行制作易拉宝、<span lang=\"EN-US\">X</span>展架等宣传海报。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">五、联系方式<span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">联系人：周经理</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">联系电话：<span lang=\"EN-US\">0512</span>―<span lang=\"EN-US\">88989800</span>、<span lang=\"EN-US\">88989789</span>、<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\">电子邮箱：<span lang=\"EN-US\"><a href=\"mailto:xyl@1jobs.cn\">7</a>99022456@qq.com<o:p></o:p></span></span></p>','苏州吴江区长安路3223号人社大厦一楼','周经理','0512-88989800','108.201.203路公交到人社大厦站可达','1386950400','1386345600','1386950400','0','64','1386393127','0','1','1386345600','0');
