平米，档案室<span lang=\"EN-US\">80</span>平米，拥有室内室外二块大型<span lang=\"EN-US\">LED</span>电子显示屏，人数计数器、自助招聘摊位<span lang=\"EN-US\">12</span>个<span lang=\"EN-US\">,</span>常设招聘摊位<span lang=\"EN-US\">64</span>个，以及网络招聘室、视频招聘室、自助招聘摊位、面谈式招聘摊位等。实现了自助式求职招聘、摊位式洽谈招聘、网络招聘和视频招聘等功能。现将本次招聘会有关事项通知如下。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-size:12pt;font-family:宋体;\">一、主办、承办单位<span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12pt;font-family:宋体;\">主办：吴江区人力资源和社会保障局<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12pt;font-family:宋体;\">承办：吴江区就管中心、吴江区人力资源市场<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-size:12pt;font-family:宋体;\">二、时间、地点<span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12pt;font-family:宋体;\">时间：<span lang=\"EN-US\">1</span>月<span lang=\"EN-US\">4</span>日（星期六）<span lang=\"EN-US\">8</span>：<span lang=\"EN-US\">30</span>―<span lang=\"EN-US\">12</span>：<span lang=\"EN-US\">00<o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12pt;font-family:宋体;\">地点：吴江区人力资源市场（长安路<span lang=\"EN-US\">3223</span>号，人社大厦一楼）<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-size:12pt;font-family:宋体;\">三、</span></b><b><span style=\"font-size:12pt;font-family:宋体;\">有关要求</span></b></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12pt;font-family:宋体;\">1</span><span style=\"font-size:12pt;font-family:宋体;\">、本次招聘会预设展位64个，用人单位免费进场，<span lang=\"EN-US\">2014</span>届高校毕业生及市内相关求职者均可免费进场应聘求职。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12pt;font-family:宋体;\">2</span><span style=\"font-size:12pt;font-family:宋体;\">、请用人单位请根据需要制定招聘计划。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12pt;font-family:宋体;\">3</span><span style=\"font-size:12pt;font-family:宋体;\">、请参加招聘的用人单位在<span lang=\"EN-US\">12</span>月<span lang=\"EN-US\">10</span>日前持营业执照副本、经办人身份证复印件及招聘信息电子版到吴江区人力资源市场（长安路<span lang=\"EN-US\">3223</span>号人社大厦一楼）报名或将营业执照副本、经办人身份证复印件及招聘信息电子版传真邮箱。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size:12pt;font-family:宋体;\">4</span><span style=\"font-size:12pt;font-family:宋体;\">、请用人单位自行制作易拉宝、<span lang=\"EN-US\">X</span>展架等宣传海报。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><b><span style=\"font-size:12pt;font-family:宋体;\">四、联系方式<span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12pt;font-family:宋体;\">联系人：周经理</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12pt;font-family:宋体;\">联系电话：<span lang=\"EN-US\">0512</span>―<span lang=\"EN-US\">88989800</span>、<span lang=\"EN-US\">88989789</span>、<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12pt;font-family:宋体;\">电子邮箱：<span lang=\"EN-US\"><a href=\"mailto:xyl@1jobs.cn\">7</a>99022456@qq.com</span></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size:12pt;font-family:宋体;\"><span lang=\"EN-US\">官方求职QQ群：</span></span><span style=\"font-family:微软雅黑, Tahoma, 宋体;font-size:14px;line-height:29px;text-align:-webkit-auto;\">119326964</span></p>','苏州吴江区长安路3223号人社大厦一楼','周经理','0512-88989800','108.201.203路公交到人社大厦站即可到达','1388764800','1387123200','1388678400','16','64','1387170258','0','1','1387123200','0');
