INSERT INTO `qs_jobfair` VALUES ('233','8','1','2','1','1','0','苏州吴江区人力资源市场2014.3.1公益招聘会','#f00','1','综合','&nbsp;<p style=\"text-align:center;margin:3.75pt 0cm;mso-line-height-alt:13.5pt;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"center\"><b><span style=\"font-family:宋体;color:black;font-size:16pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">吴江区<span lang=\"EN-US\">2014</span>年</span></b><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></span></p>\r\n<p style=\"text-align:center;margin:3.75pt 0cm;mso-line-height-alt:13.5pt;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"center\"><b><span style=\"font-family:宋体;color:black;font-size:16pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">吴江区人力资源市场公益招聘会</span></b><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:center;margin:3.75pt 0cm;mso-line-height-alt:13.5pt;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"center\"><b><span style=\"font-family:宋体;color:black;font-size:16pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">通知</span></b><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><b><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">各有关单位：</span></b><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\" lang=\"EN-US\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">为深入贯彻落实党的十八届三中全会精神，充分发挥各地各人力资源市场在促进就业中的主导作用，进一步做好<span lang=\"EN-US\">2014</span>年各项就业工作。根据人力资源和社会保障部办公厅《关于举办<span lang=\"EN-US\">2013</span>年全国人力资源市场高校毕业生就业服务周活动的通知》（人社厅发【<span lang=\"EN-US\">2013</span>】<span lang=\"EN-US\">104</span>号）要求，我区将定期举办公益招聘会，为吴江市民求职招聘搭建桥梁。</span><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;text-indent:24pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">苏州市吴江区是临沪临浙重要的制造业基地，人力资源服务需求强劲。一直以来，区人力资源市场秉承“服务民生、服务企业、服务发展”的宗旨，取得显著成绩。<span lang=\"EN-US\">2012</span>年，吴江区人力资源市场被江苏省人社厅评定为“江苏省五星级公共人力资源市场”。</span><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;text-indent:24pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">吴江区人力资源市场布局合理，设施齐全，功能完备。作为其载体的吴江区人力资源和社会保障服务大厦，总投资<span lang=\"EN-US\">3</span>个亿，总面积达<span lang=\"EN-US\">3</span>万平米。区人力资源市场于<span lang=\"EN-US\">2012</span>年<span lang=\"EN-US\">9</span>月正式建成投入使用，借鉴国内外多家人力资源市场的建设经验，专业规划，摊位宽敞。商务中心、网络控制、信息查询、技能测评等区域一应具有。市场招聘大厅达<span lang=\"EN-US\">2270</span>平米，档案室<span lang=\"EN-US\">80</span>平米，拥有室内室外二块大型<span lang=\"EN-US\">LED</span>电子显示屏，人数计数器、自助招聘摊位<span lang=\"EN-US\">12</span>个<span lang=\"EN-US\">,</span>常设招聘摊位<span lang=\"EN-US\">64</span>个，以及网络招聘室、视频招聘室、自助招聘摊位、面谈式招聘摊位等。实现了自助式求职招聘、摊位式洽谈招聘、网络招聘和视频招聘等功能。现将本次招聘会有关事项通知如下。</span><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><b><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">一、主办、承办单位</span></b><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">主办：吴江区人力资源和社会保障局</span><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">承办：吴江区就管中心、吴江区人力资源市场</span><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><b><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">二、时间、地点</span></b><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">时间：<span lang=\"EN-US\">3</span>月<span lang=\"EN-US\">1</span>日（星期六<span lang=\"EN-US\">8</span>：<span lang=\"EN-US\">30</span>―<span lang=\"EN-US\">12</span>：<span lang=\"EN-US\">00</span>）</span><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">地点：吴江区人力资源市场（长安路<span lang=\"EN-US\">3223</span>号，人社大厦一楼）</span><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><b><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">三、有关要求</span></b><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\" lang=\"EN-US\">1</span><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">、本次招聘会预设展位<span lang=\"EN-US\">64</span>个，用人单位免费进场，高校毕业生及市内相关求职者均可免费进场应聘求职。</span><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\" lang=\"EN-US\">2</span><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">、请用人单位请根据需要制定招聘计划。</span><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\" lang=\"EN-US\">3</span><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">、请参加招聘的用人单位持营业执照副本、经办人身份证复印件及招聘信息电子版到吴江区人力资源市场（长安路<span lang=\"EN-US\">3223</span>号人社大厦一楼）报名或将营业执照副本、经办人身份证复印件及招聘信息电子版传真邮箱。</span><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\" lang=\"EN-US\">4</span><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">、请用人单位自行制作易拉宝、<span lang=\"EN-US\">X</span>展架等宣传海报。</span><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><b><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">四、联系方式</span></b><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">联系人：周经理</span><span style=\"font-family:''Tahoma'',''sans-serif'';color:black;font-size:9pt;mso-font-kerning:0pt;mso-fareast-font-family:宋体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">联系电话：<span lang=\"EN-US\">0512</span>―<span lang=\"EN-US\">88989800</span>、<span lang=\"EN-US\">88989789<o:p></o:p></span></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orphan;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\">电子邮箱：</span><span lang=\"EN-US\"><a href=\"mailto:799022456@qq.com\"><span style=\"color:black;text-decoration:none;text-underline:none;\"><span style=\"font-family:Calibri;font-size:small;\">799022456@qq.com</span></span></a></span><span style=\"font-family:宋体;color:black;font-size:12pt;mso-bidi-font-family:Tahoma;mso-font-kerning:0pt;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"text-align:left;line-height:13.5pt;margin:3.75pt 0cm;mso-pagination:widow-orph